INSERT INTO `text` VALUES (1,'<strong>MediaWiki se ha instalado.</strong>\n\nConsulta la [https://meta.wikimedia.org/wiki/Help:Contents/es guía del usuario] para obtener información sobre el uso del software wiki.\n\n== Primeros pasos ==\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Configuration_settings Lista de ajustes de configuración]\n* [https://www.mediawiki.org/wiki/Manual:FAQ/es Preguntas frecuentes sobre MediaWiki]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce Lista de correo de anuncios de publicación de MediaWiki]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Localisation#Translation_resources Traducir MediaWiki en tu idioma]\n* [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:Combating_spam Aprende cómo combatir el spam en tu wiki]','utf-8'),(2,'== Push to Server ==\n\n=== Backup Database ===','utf-8'),(3,'== Push to Server ==\n\n=== WP Site ===\n=== Backup Database ===\n\nsudo -i\ncd /var/www/html/wp/\nsudo mysqldump -u goctalab_admin -p[password] goctalab_wp > goctalab_wp_db_bak.sql','utf-8'),(4,'== Push to Server ==\n\n=== WP Site ===\n=== Backup Database ===\n\nsudo -i\n\ncd /var/www/html/wp/\n\nsudo mysqldump -u goctalab_admin -p[password] goctalab_wp > goctalab_wp_db_bak.sql','utf-8'),(5,'== Push to Server ==\n\n=== WP Site ===\n=== Backup Database ===\n\nsudo -i\n\ncd /var/www/html/wp/\n\nsudo mysqldump -u goctalab_admin -p[password] goctalab_wp > goctalab_wp_db_bak.sql\n\ngit add -A && git commit -m \"Your Message\"','utf-8'),(6,'== Push to Server ==\n\n=== WP Site ===\n=== Root Access and CD ===\n\n<code> sudo -i </code>\n\ncd /var/www/html/wp/\n\n=== Backup Database ===\n\nsudo mysqldump -u goctalab_admin -p[password] goctalab_wp > goctalab_wp_db_bak.sql\n\ngit add -A && git commit -m \"[your commit message]\"','utf-8'),(7,'== Push to Server ==\n\n=== WP Site ===\n=== Root Access and Change Directory ===\n\n<code> sudo -i </code>\n\n<code> cd /var/www/html/wp/ </code>\n\n=== Backup Database ===\n\n<code> sudo mysqldump -u goctalab_admin -p[password] goctalab_wp > goctalab_wp_db_bak.sql </code>\n\n=== Stage and Commit ===\n\n<code> git add -A && git commit -m \"[your commit message]\" </code>\n\n=== Push to Github ===','utf-8'),(8,'== Push to server ==\n\n=== WordPress site ===\n\n==== Steps on the local machine ====\n\n===== Root access and change directory =====\n\n<code> sudo -i </code>\n\n<code> cd /var/www/html/wp/ </code>\n\n===== Backup database =====\n\n<code> sudo mysqldump -u goctalab_admin -p[password] goctalab_wp > goctalab_wp_db_bak.sql </code>\n\n===== Stage and commit =====\n\n<code> git add -A && git commit -m \"[your commit message]\" </code>\n\n===== Push to Github =====\n\n<code> git push origin master </code>','utf-8'),(9,'== Push to server ==\n\n=== WordPress site ===\n\n==== Steps on the local machine ====\n\n* Root access and change directory\n\n<code> sudo -i </code>\n\n<code> cd /var/www/html/wp/ </code>\n\n* Backup database \n\n<code> sudo mysqldump -u goctalab_admin -p[password] goctalab_wp > goctalab_wp_db_bak.sql </code>\n\n* Stage and commit\n\n<code> git add -A && git commit -m \"[your commit message]\" </code>\n\n* Push to github \n\n<code> git push origin master </code>','utf-8'),(10,'== Push to server ==\n\n=== WordPress site ===\n\n==== Steps on the local machine ====\n\n# Root access and change directory\n\n<code> sudo -i </code>\n\n<code> cd /var/www/html/wp/ </code>\n\n# Backup database \n\n<code> sudo mysqldump -u goctalab_admin -p[password] goctalab_wp > goctalab_wp_db_bak.sql </code>\n\n# Stage and commit\n\n<code> git add -A && git commit -m \"[your commit message]\" </code>\n\n# Push to github \n\n<code> git push origin master </code>','utf-8'),(11,'== Push to server ==\n\n=== WordPress site ===\n\n==== Steps on the local machine ====\n\n===== Root access and change directory =====\n\n<code> sudo -i </code>\n\n<code> cd /var/www/html/wp/ </code>\n\n===== Backup database =====\n\n<code> sudo mysqldump -u goctalab_admin -p[password] goctalab_wp > goctalab_wp_db_bak.sql </code>\n\n===== Stage and commit =====\n\n<code> git add -A && git commit -m \"[your commit message]\" </code>\n\n===== Push to github =====\n\n<code> git push origin master </code>','utf-8'),(12,'== Push to server ==\n\n=== WordPress site ===\n\n==== Steps on the local machine ====\n\n===== Root access and change directory =====\n\n<code> sudo -i </code>\n<code> cd /var/www/html/wp/ </code>\n\n===== Backup database =====\n\n<code> sudo mysqldump -u goctalab_admin -p[password] goctalab_wp > goctalab_wp_db_bak.sql </code>\n\n===== Stage and commit =====\n\n<code> git add -A && git commit -m \"[your commit message]\" </code>\n\n===== Push to github =====\n\n<code> git push origin master </code>\n\n==== Steps on the remote machine ====\n\n===== SSH into server and change directory=====\n\n<code> ssh goctalab@goctalab.org.pe </code>\n<code> cd /home/goctalab/www/wp/ </code>','utf-8'),(13,'== Push to server ==\n\n=== WordPress site ===\n\n==== Steps on the local machine ====\n\n====== Root access and change directory ======\n\n<code> sudo -i </code>\n<code> cd /var/www/html/wp/ </code>\n\n====== Backup database ======\n\n<code> sudo mysqldump -u goctalab_admin -p[password] goctalab_wp > goctalab_wp_db_bak.sql </code>\n\n====== Stage and commit ======\n\n<code> git add -A && git commit -m \"[your commit message]\" </code>\n\n====== Push to github ======\n\n<code> git push origin master </code>\n\n==== Steps on the remote machine ====\n\n====== SSH into server and change directory ======\n\n<code> ssh goctalab@goctalab.org.pe </code>\n<code> cd /home/goctalab/www/wp/ </code>','utf-8'),(14,'== Push to server ==\n\n=== WordPress site ===\n\n==== Steps on the local machine ====\n\n; 1) Root access and change directory : <code> sudo -i </code>\n; name 2 : value 2\n; name 3 : value 3\n\n====== Root access and change directory ======\n\n<code> sudo -i </code>\n<code> cd /var/www/html/wp/ </code>\n\n====== Backup databas