cd /var/www/html/wiki/ </code>\n\n:\'\'\' Backup database \'\'\'\n\n::<code> sudo mysqldump -u goctalab_admin -p goctalab_wiki > goctalab_wiki_db_bak.sql </code>\n\n:\'\'\' Stage and commit \'\'\'\n\n::<code> git add -A && git commit -m \"[your commit message]\" </code>\n\n:\'\'\' Push to github \'\'\'\n\n::<code> git push origin master </code>\n\n==== Steps on the remote machine ====\n\n:\'\'\' SSH into server and change directory \'\'\'\n\n::<code> ssh goctalab@goctalab.org.pe </code>\n\n::<code> cd /home/goctalab/www/wiki/ </code>\n\n:\'\'\' Pull changes from GitHub \'\'\'\n\n::<code> git pull origin master </code>\n\n:\'\'\' Restore database \'\'\'\n\n::<code> mysql -u goctalab_admin -p goctalab_wiki < goctalab_wiki_db_bak.sql </code>','utf-8'),(45,'test','utf-8'),(46,'test again','utf-8'),(47,'test','utf-8'),(48,'','utf-8'),(49,'Copies of the code for the WordPress site and the MediaWiki exit in 3 places:\n* On the local development machine located at GoctaLab.\n* On a git server at [Http://www.github.com/goctalab GitHub]. \n* In production at http://www.goctalab.org.pe\nGenerally, development is done on the local development machine, then pushed to the git server then pulled into the production server. However, if changes need to be done remotely, then basically the opposite needs to occur before resuming work on the local development machine. Described below are how to run the scripts that perform these actions. \n\nAll the scripts are located on the local development machine at: /home/goctalab/sever_scripts/\n\nDO NOT under any circumstances make changes on both the development machine and the production server without running the script.\n\n== Push From Local Development Machine To Production Server ==\nThere are individual scripts for WordPress and MediaWiki. To push from the development machine to the production server, cd into the server_script directory and to run the scripts as follows:\n\n<code>cd /home/goctalab/server_scripts/</code>\n\n<code>sh ./push_wp.sh</code>\n\n<code>sh ./push_wiki.sh</code>\n\nThis will be the primary workflow. See below for the less common use case in reverse.\n\n== Push From Local Development Machine To Production Server ==\n<code>cd /home/goctalab/server_scripts/</code>\n\n<code>sh ./pull_wp.sh</code>\n\n<code>sh ./pull_wiki.sh</code>','utf-8'),(50,'The following extensions are installed in the goctalab wiki. Refer to the documentation for how to use.\n* https://www.mediawiki.org/wiki/Extension:PDFEmbed\n* https://www.mediawiki.org/wiki/Extension:EmbedVideo\n* https://www.mediawiki.org/wiki/VisualEditor','utf-8'),(51,'Copies of the code for the WordPress site and the MediaWiki exit in 3 places:\n* On the local development machine located at GoctaLab.\n* On a git server at [Http://www.github.com/goctalab GitHub]. \n* In production at http://www.goctalab.org.pe\nGenerally, development is done on the local development machine, then pushed to the git server then pulled into the production server. However, if changes need to be done remotely, then basically the opposite needs to occur before resuming work on the local development machine. Described below are how to run the scripts that perform these actions. \n\nAll the scripts are located on the local development machine at: /home/goctalab/sever_scripts/\n\n\'\'\'DO NOT under any circumstances make changes on both the development machine and the production server without running the script.\'\'\'\n\n== Push From Local Development Machine To Production Server ==\nThere are individual scripts for WordPress and MediaWiki. To push from the development machine to the production server, cd into the server_script directory and to run the scripts as follows:\n\n<code>cd /home/goctalab/server_scripts/</code>\n\n<code>sh ./push_wp.sh</code>\n\n<code>sh ./push_wiki.sh</code>\n\n\'\'\'Note that after pushing or pulling the WordPress site, you must reset the background image because for some reason it is being set by an absolute path.\'\'\'\n\nThis will be the primary workflow. See below for the less common use case in reverse.\n\n== Push From Local Development Machine To Production Server ==\n<code>cd /home/goctalab/server_scripts/</code>\n\n<code>sh ./pull_wp.sh</code>\n\n<code>sh ./pull_wiki.sh</code>','utf-8'),(52,'Copies of the code for the WordPress site and the MediaWiki exit in 3 places:\n* On the local development machine located at GoctaLab.\n* On a git server at [Http://www.github.com/goctalab GitHub]. \n* In production at http://www.goctalab.org.pe\nGenerally, development is done on the local development machine, then pushed to the git server then pulled into the production server. However, if changes need to be done remotely, then basically the opposite needs to occur before resuming work on the local development machine. Described below are how to run the scripts that perform these actions. \n\nAll the scripts are located on the local development machine at: /home/goctalab/sever_scripts/\n\n\'\'\'DO NOT under any circumstances make changes on both the development machine and the production server without running the script.\'\'\'\n\n== Push From Local Development Machine To Production Server ==\nThere are individual scripts for WordPress and MediaWiki. To push from the development machine to the production server, cd into the GL_website_dev_scripts directory and to run the scripts as follows:\n\n<code>cd /home/goctalab/GL_website_dev_scripts/</code>\n\n<code>sh ./push_wp.sh</code>\n\n<code>sh ./push_wiki.sh</code>\n\n\'\'\'Note that after pushing or pulling the WordPress site, you must reset the background image because for some reason it is being set by an absolute path.\'\'\'\n\nThis will be the primary workflow. See below for the less common use case in reverse.\n\n== Pull From Production Server To Local Development Machine ==\nBecause these scripts will and should be used rarely, they have been placed in a subdirectory called pull_scripts.\n\n<code>cd /home/goctalab/GL_website_dev_scripts/pull_scripts/</code>\n\n<code>sh ./pull_wp.sh</code>\n\n<code>sh ./pull_wiki.sh</code>','utf-8'),(53,'Copies of the code for the WordPress site and the MediaWiki exit in 3 places:\n* On the local development machine located at GoctaLab.\n* On a git server at [Http://www.github.com/goctalab GitHub]. \n* In production at http://www.goctalab.org.pe\nGenerally, development is done on the local development machine, then pushed to the git server then pulled into the production server. However, if changes need to be done remotely, then basically the opposite needs to occur before resuming work on the local development machine. Described below are how to run the scripts that perform these actions. \n\nAll the scripts are located on the local development machine at: /home/goctalab/sever_scripts/\n\n\'\'\'DO NOT under any circumstances make changes on both the development machine and the production server without running the script.\'\'\'\n\n== Push From Local Development Machine To Production Server ==\nThere are individual scripts for WordPress and MediaWiki. To push from the development machine to the production server, cd into the GL_website_dev_scripts directory and to run the scripts as follows:\n\n<code>cd /home/goctalab/GL_website_dev_scripts/</code>\n\n<code>sudo sh ./push_wp.sh</code>\n\n<code>sudo sh ./push_wiki.sh</code>\n\n\'\'\'Note that after pushing or pulling the WordPress site, you must reset the background image because for some reason it is being set by an absolute path.\'\'\'\n\nThis will be the primary workflow. See below for the less common use case in reverse.\n\n== Pull From Production Server To Local Development Machine ==\nBecause these scripts will and should be used rarely, they have been placed in a subdirectory called pull_scripts.\n\n<code>cd /home/goctalab/GL_website_dev_scripts/pull_scripts/</code>\n\n<code>sudo sh ./pull_wp.sh</code>\n\n<code>sudo sh ./pull_wiki.sh</code>','utf-8'),(54,'Revoques naturales en Cocachimba - Andri Matsuda :: Ruta de la Bioconstruccion \n\nExperiencia de nuestra residente con arcillas de la zona con aplicacion de Suero de Leche y bosta de vaca fermentada para mayor resistencia a la lluvia y abrasion.\n\nTabla de formulas adjuntas con soporte de imagenes.','utf-8'),(55,'Revoques naturales en Cocachimba - Andri Matsuda :: Ruta de la Bioconstruccion \n\nExperiencia de nuestra residente con arcillas de la zona con aplicacion de Cal, Suero de Leche y bosta de vaca fermentada para mayor resistencia a la lluvia y abrasion.\n\nTabla de formulas adjuntas con soporte de imagenes.','utf-8'),(56,'Revoques Ruta de la Bioconstruccion - Andri Matsuda\n\nExperiencia de nuestra residente Andri Matsuda con combinacion de arcillas de la zona con aplicacion de Suero de Leche y bosta de vaca fermentada.\n\nTabla de formulas adjunta con imagenes de soporte.\n\n[[Media:Revoques y Pinturas Naturales Cocachimba.pdf]]','utf-8'),(57,'Revoques Naturales  - Andri Matsuda : Ruta de la Bioconstruccion\n\nExperiencia de nuestra residente GoctaLab Andri Matsuda .  Combinacion de arcillas de la zona con aplicacion de Cal Suero de Leche y bosta de vaca fermentada.\n\nTabla de formulas adjunta con imagenes de soporte.\n\n[[Media:Revoques y Pinturas Naturales Cocachimba.pdf]]','utf-8'),(58,'Revoques Naturales  - Andri Matsuda : Ruta de la Bioconstruccion\n\nExperiencia de nuestra residente GoctaLab Andri Matsuda .  Combinacion de arcillas de la zona con aplicacion de Cal, Suero de Leche y bosta de vaca fermentada.\n\nTabla de formulas adjunta con imagenes de soporte.\n\n[[Media:Revoques y Pinturas Naturales Cocachimba.pdf]]','utf-8'),(59,'Buzón e Indice  de la investigacion de los residentes de GoctaLab  +  Material de soporte de libre distribución. PIRATEA Y DIFUNDE!','utf-8'),(60,'Revoques naturales en Cocachimba - Andri Matsuda :: Ruta de la Bioconstruccion \n\nExperiencia de nuestra residente con arcilla de la zona con aplicacion de Cal, Suero de Leche y bosta de vaca fermentada para mayor resistencia a la lluvia y abrasion.\n\nTabla de formulas adjuntas con soporte de imagenes.','utf-8'),(61,'Buzón e Indice  de la investigacion de los residentes de GoctaLab  +  Material de soporte de libre distribución. \'\'\'PIRATEA Y DIFUNDE!\'\'\'','utf-8'),(62,'Investigación sobre algunas plantas locales disponibles en Cocachimba y un tratamiento de purificación de la sangre.\n\nEsta investigación fue compilada por nuestros residentes de GoctaLab : Francesca Mori, Erika Pani y Nico Stegman quienes experimentaron en ellos mismos un tratamiento de desintoxicación causada por picaduras de insectos durante su estadia en la selva baja. \n\nEllos convivieron con nosotros aqui en GoctaLab y emprendieron con exito, y la ayuda de nuestro querido herbalista de cocachimba Candelario Santillan y otros portadores del conocimiento local, la cura y la vuelta a la salud.\n\n\n[[File:DOCUMENTO DE PLANTAS MEDICINALES.docx]]','utf-8'),(63,'Investigación sobre algunas plantas locales disponibles en Cocachimba y un tratamiento de purificación de la sangre.\n\nEsta investigación fue compilada por nuestros residentes de GoctaLab : Francesca Mori, Erika Pani y Nico Stegman quienes experimentaron en ellos mismos un tratamiento de desintoxicación causada por picaduras de insectos durante su estadia en la selva baja.\n\nEllos convivieron con nosotros aqui en GoctaLab y emprendieron con exito, y la ayuda de nuestro querido herbalista de cocachimba Candelario Santillan y otros portadores del conocimiento local, la cura y la vuelta a la salud.','utf-8');
